import axios from "axios";
import React, {useState} from "react";

function auth(){
  let data;
  function setData(d){
    console.log("d: " + d)
    data = d
  }
  axios({
    method: 'get',
    withCredentials: true,
    url: 'http://localhost:5000/user/auth',
  }).then(res => setData(res.data))

  return data
}

export default auth;
